import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/Header'
import Result from './components/Result'

class App extends Component {

  state = {

    report:null
  }


  componentDidMount() {
   fetch("localhost:3000/report")
     .then(res =>res.json())
     .then(res => this.setState({report: res.report }));
 }




   render() {
     const link = this.state.authorize
     const report = this.state.report
     return (
       <div className="App">

        {this.state.reports ? 
           <Header link={link} />:
           <Result link={link} report={report} />

         }



       </div>
     );
   }
 }

export default App;
